import React from 'react';

import { EuiImage } from '../../../../src/components';

export default () => (
  <EuiImage
    size="l"
    hasShadow
    caption="Random nature image"
    alt="Random nature image"
    url="https://source.unsplash.com/300x300/?Nature"
  />
);
